export const srided = data.map(point => {
  const utm = `+proj=utm +zone=10 +ellps=WGS84 +datum=WGS84 +units=m +no_defs`

  const arr = point.slice(8,10)

  const newPointArr = proj(
    utm, 
    'EPSG:4326' ,  
    arr.map(coo => parseFloat(coo))
  )

  point[8] = newPointArr[0]
  point[9] = newPointArr[1]
  return point
})
